B.Ka=new A.bp(B.KX,["Quran Library","\u0645\u0643\u062a\u0628\u0629 \u0627\u0644\u0642\u0631\u0622\u0646","Docs","Search","\u0627\u0644\u0639\u0631\u0628\u064a\u0629","English","\u09ac\u09be\u0982\u09b2\u09be","Bahasa Indonesia","\u0627\u0631\u062f\u0648","T\xfcrk\xe7e","\u06a9\u0648\u0631\u062f\u06cc","Bahasa Malaysia","Espa\xf1ol","Documentation","Comprehensive guide to using Quran Library","Getting Started","Usage Examples","Utils","Fonts Download","Tafsir","Audio Playback","What is Quran Library?","Motivation Behind Library","Installation","Initial Setup","First Example","Basic Quran Screen","Individual Surah Display","Utility Functions","Navigation and Jumping","Bookmarks","Quran Search","Download Quran Fonts","Tafsir Initialization","Verse Audio Playback","Surah Audio Playback","Download Management","Position Control & Resume","Customization","Theming","Fonts and Typography","Colors and Appearance","API Reference","Core Classes","Widget Catalog","Configuration Options","Quran Library is a comprehensive and developed Flutter library for displaying the Holy Quran. This library is a continuation of flutter_quran by Hesham Erfan with many new and improved features.","Comprehensive Quran Library for Flutter","The library features an easy-to-use interface and advanced features such as displaying Quran with custom fonts, verse search, bookmarks, tafsir, and translations.","Modern applications rarely come with all the information necessary to render their User Interface. Instead, data is often fetched asynchronously from a server.","The problem is, working with asynchronous code is hard. Although Flutter comes with some way to create state variables and refresh the UI on change, it still fails on some fundamental details.","Our goal is to provide a comprehensive and easy-to-use library for displaying the Holy Quran in Flutter applications with efficient state management and beautiful user interface.","In your Flutter project's pubspec.yaml file, add the following dependency:","Run the following command to get packages:","Import the library in your Dart file:","Before using the library, you need to initialize it first:","You can easily add a Quran screen to your app as shown below:",u.bh,"Main Features","Complete Quran display with beautiful fonts","Fast search in verses and surahs","Advanced bookmarking system","Support for tafsir and different translations","Customizable user interface","Responsive design that works on all devices","Multi-language support","High performance and fast navigation","Important Note","Warning","Make sure to set useMaterial3: false in ThemeData to ensure the library works correctly.","You must add drift_flutter for Android to enable tafsir feature.","Copied!","Copy","Search documentation","Search Results","results","No results found","The Quran Library was developed to provide a comprehensive and integrated solution for displaying the Holy Quran in Flutter applications. This library meets the needs of developers who seek to create high-quality Islamic applications.","Key Benefits","High performance and smooth display","Special optimization for Arabic texts and Islamic fonts","Comprehensive features for reading, searching, and navigation","Full support for audio recitation","Offline capability without internet connection","This library is designed to be easy-to-use for beginner developers and flexible enough for advanced developers.",u.z,u.bh,"or give it some options:","You can customize many options according to your app needs.","For displaying a single surah with custom pagination:",u.ag,u.aS,u.cC,"to jump between pages, Surahs or Hizbs you can use","Adding, setting, removing, getting and navigating to bookmarks","searching for any Ayah","All these utilities are available in Quran Library to make development easier.","To download Quran fonts you have two options: either use the default dialog where you can modify its properties, or you can create your own design using all the functions for downloading fonts.","Download Options","You can use the default dialog or create a custom design.","Important Note for macOS","macOS needs you to request a specific entitlement in order to access the network. To do that: open macOS/Runner/DebugProfile.entitlements and add the required key-value pair.","Fonts Download Dialog","Fonts Download Widget","Font Control Methods","All these methods are available for managing Quran fonts download and usage.","Permissions","Permissions","Android","The required permissions for audio playback (WAKE_LOCK, FOREGROUND_SERVICE, and FOREGROUND_SERVICE_MEDIA_PLAYBACK) are automatically added by the package. You don't need to manually edit your AndroidManifest.xml.","iOS","For background audio playback, you must add the following to your app's Info.plist:","This allows audio playback to continue when the app is in the background.","Initialize Library",u.z,"Advanced Options","Or give it some options:","For displaying a single surah with custom pagination",u.ag,u.aS,u.cC,"to jump between pages, Surahs or Hizbs you can use:","Adding, setting, removing, getting and navigating to bookmarks:","searching for any Ayah","To download Quran fonts, you have two options:","As for using the default dialog, you can modify the style in it.","Or you can create your own design using all the functions for downloading fonts.","macOS needs you to request a specific entitlement in order to access the network.","To do that: open macos/Runner/DebugProfile.entitlements and add the following key-value pair.","Available methods for fonts management:","Important note before starting to use Tafsir: Please add this library to your pubspec.yaml file only for Android:","to avoid any problems when showing the tafsir","Initialize tafsir","Usage Example","Available Tafsir Methods:","This section provides comprehensive capabilities for audio playback of the Holy Quran with background playback support and advanced audio file management.","Verse Audio Playback","All these functions provide comprehensive verse-level audio control.","Surah Audio Playback","These functions provide complete surah-level audio management.","Download Management","Position Control & Resume","Complete Audio Example","Audio Features Summary:","\u2705 Individual or sequential verse playback","\u2705 Complete surah playback","\u2705 Navigation tools between verses and surahs","\u2705 Offline download","\u2705 Resume from last position","\u2705 Background playback","\u2705 Position tracking","\u2705 Comprehensive download and cancellation management","You can also use the default Quran font or Naskh font:","hafsStyle is the default style for Quran so all special characters will be rendered correctly","naskhStyle is the default style for other text.","\u0645\u0642\u062f\u0645\u0629","\u0627\u0644\u0628\u062f\u0621 \u0627\u0644\u0633\u0631\u064a\u0639","\u0627\u0644\u062e\u064a\u0627\u0631\u0627\u062a \u0648\u0627\u0644\u062a\u062e\u0635\u064a\u0635","\u0627\u0644\u0645\u064a\u0632\u0627\u062a \u0627\u0644\u0645\u062a\u0642\u062f\u0645\u0629","\u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u0628\u062d\u062b","\u062f\u0645\u062c \u0627\u0644\u062a\u0641\u0633\u064a\u0631","\u0627\u0644\u0633\u0645\u0627\u062a \u0627\u0644\u0645\u062e\u0635\u0635\u0629"],t.l)
